#include <iostream>
#include <string>

using namespace std;

bool checkPalindrome(string s, int start, int end) {
  int i = start;
  int j = end;
  while (j >= i) {
    if (s[i] != s[j]) {
      return (false);
    }
    i++;
    j--;
  }
  return (true);
}

bool validPalindrome(string s) {
  int i = 0;
  int j = s.length() - 1;
  while (j >= i) {
    if (s[i] != s[j]) {
      if (checkPalindrome(s,i+1,j)) {
        return (true);
      } else if (checkPalindrome(s,i,j-1)) {
        return (true);
      } else {
        return (false);
      }
    } 
    i++;
    j--;
  }
  return (true);
}

int main (int argc, char **argv) {

  string s = "";
  cout << s.length() << "\n";
  if (validPalindrome(s)) {
    cout << "True\n";
  } else {
    cout << "False\n";    
  }
  
}
